protected static EventListener removeInternal(EventListener l, EventListener oldl) {
    if (l == oldl || l == null) {
        return null;
    } else if (l instanceof FigureChangeEventMulticaster) {
        return ((FigureChangeEventMulticaster) l).remove(oldl);
    } else {
        // it's not here
        return l;
    }
}
